import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';

let TextData = [
    {id: 1, text: '4444444'},
    {id: 2, text: 'acascascascsac'},
    {id: 3, text: 'dvsvsdacascascascsac'},
    {id: 4, text: 'acascascascsac'}
]
let DialogData = [
    {id: 1, name: 'Mikee'},
    {id: 2, name: 'Denis'},
    {id: 3, name: 'Mikee'},
    {id: 4, name: 'Mikee'},
    {id: 5, name: 'Ylia'}
]
let PostData = [
    {id: 1, text: '5555555555555', like: 22},
    {id: 2, text: 'acascascascsac', like: 22},
    {id: 3, text: 'acascascascsac', like: 22},
    {id: 3, text: 'acascascascsac', like: 22},
    {id: 3, text: 'acascascascsac', like: 22},
    {id: 3, text: 'acascascascsac', like: 22},
    {id: 4, text: 'acascavdvdvdscascsac', like: 22}
]
ReactDOM.render(
        <App TextData={TextData} DialogData={DialogData} PostData={PostData}/>,
    document.getElementById('root')
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
